import React from 'react';
import styles from './Sidebar.module.css'; // Ensure your module.css file matches the class names used

const Sidebar = () => {
    return (
        <aside id="sidebar" className={styles.sidebar}>
            <button className={styles.sidebarButton}>Main</button>
            <button className={styles.sidebarButton}>Settings</button>
            <button className={styles.sidebarButton}>About</button>
        </aside>
    );
};

export default Sidebar;
